import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';
import Home from './Pages/Home/Home';
import MyApplication from './Pages/My-Application/MyApps';
import Shifts from './Pages/Shifts/Shifts';
import InternetStatus from './Pages/InternetStatus/InternetStatus';
import Chat from './Pages/Chats/Chats';
import Login from './Pages/Login/Login';
import Signup from './Pages/Signup/Signup';
import TechnicianProfile from './Protected_Apps/TechnicianProfile/TechnicianProfile';
import TechnicianTickets from './Protected_Apps/Tickets/TechnicianTickets';
import ClientProfile from './Protected_Apps/ClientProfile/ClientProfile';
import NotFound from './Pages/NotFound/NotFound';

function App() {
    const [authState, setAuthState] = useState({
        isAuthenticated: false,
        username: '',
        email: '',
        userType: '',
        isLoading: true
    });

    // Check for existing session on initial load
    useEffect(() => {
        const userInfo = JSON.parse(localStorage.getItem('userInfo'));
        if (userInfo?.token) {
            setAuthState({
                isAuthenticated: true,
                username: userInfo.username,
                email: userInfo.email,
                userType: userInfo.userType,
                isLoading: false
            });
        } else {
            setAuthState(prev => ({ ...prev, isLoading: false }));
        }
    }, []);

    const handleLogin = (userData) => {
        localStorage.setItem('userInfo', JSON.stringify({
            token: userData.token,
            username: userData.username,
            email: userData.email,
            userType: userData.userType,
            id: userData.id
        }));

        setAuthState({
            isAuthenticated: true,
            username: userData.username,
            email: userData.email,
            userType: userData.userType,
            isLoading: false
        });
    };

    const handleLogout = () => {
        localStorage.removeItem('userInfo');
        setAuthState({
            isAuthenticated: false,
            username: '',
            email: '',
            userType: '',
            isLoading: false
        });
    };

    // Protected Route Component
    const ProtectedRoute = ({ children, requiredUserType }) => {
        if (authState.isLoading) {
            return <div className="loading-spinner">Loading...</div>;
        }

        if (!authState.isAuthenticated) {
            return <Navigate to="/login" replace />;
        }

        if (requiredUserType && authState.userType !== requiredUserType) {
            return <Navigate to="/not-found" replace />;
        }

        return children;
    };

    // Public Route Component
    const PublicRoute = ({ children }) => {
        if (authState.isLoading) {
            return <div className="loading-spinner">Loading...</div>;
        }

        if (authState.isAuthenticated) {
            return <Navigate to={authState.userType === 'technician' ? '/technician-profile' : '/client-profile'} replace />;
        }

        return children;
    };

    return (
        <Router>
            <Navbar 
                isAuthenticated={authState.isAuthenticated}
                username={authState.username}
                email={authState.email}
                userType={authState.userType}
                onLogout={handleLogout}
            />

            <Routes>
                {/* Public Routes */}
                <Route path="/" element={<Home />} />
                <Route path="/login" element={
                    <PublicRoute>
                        <Login onLogin={handleLogin} />
                    </PublicRoute>
                } />
                <Route path="/signup" element={
                    <PublicRoute>
                        <Signup />
                    </PublicRoute>
                } />

                {/* Protected Technician Routes */}
                <Route path="/technician-profile" element={
                    <ProtectedRoute requiredUserType="technician">
                        <TechnicianProfile 
                            username={authState.username}
                            email={authState.email}
                            userType={authState.userType}
                        />
                    </ProtectedRoute>
                } />

                <Route path="/my-application" element={
                    <ProtectedRoute requiredUserType="technician">
                        <MyApplication />
                    </ProtectedRoute>
                }>
                    <Route path="tickets" element={<TechnicianTickets />} />
                </Route>

                {/* Protected Client Routes */}
                <Route path="/client-profile" element={
                    <ProtectedRoute requiredUserType="client">
                        <ClientProfile 
                            username={authState.username}
                            email={authState.email}
                            userType={authState.userType}
                        />
                    </ProtectedRoute>
                } />

                {/* Shared Protected Routes */}
                <Route path="/shifts" element={
                    <ProtectedRoute>
                        <Shifts />
                    </ProtectedRoute>
                } />
                <Route path="/internet-status" element={
                    <ProtectedRoute>
                        <InternetStatus />
                    </ProtectedRoute>
                } />
                <Route path="/chat" element={
                    <ProtectedRoute>
                        <Chat />
                    </ProtectedRoute>
                } />

                {/* Error Handling */}
                <Route path="/not-found" element={<NotFound />} />
                <Route path="*" element={<Navigate to="/not-found" replace />} />
            </Routes>
        </Router>
    );
}

export default App;
